import { Link } from 'react-router-dom';

const Page404 = () => {
  return (
    <>
      <h1>404 Page</h1>
      <p>This URL is not Present</p>
      <Link to="/">Go to the Home Page</Link>
    </>
  );
};

export default Page404;
